function addMobile() {
  console.log('hi');

  if (window.matchMedia('(max-width: 640px)').matches) {
    document.body.classList.add('mobile');
  } else {
    document.body.classList.remove('mobile');
  }
}

addMobile();
window.addEventListener('resize', throttle(addMobile, 150));
